const cardN = [{City: "London" , web:"html://www.peoplemakeglasgow.com"},
            {City: "New York" , web:"visitmanchester.com"},
            {City: "Paris" , web:"visitlondon.com"}
]
const TouristInfoCards = () => {
    cardN.map((element , index) => {
    console.log(element.City , index + " element " );
    return (
        <div className="card">
	        <img src="https://image.flaticon.com/icons/svg/139/139899.svg" className="card-img-top" />
	        <div className="card-body">
            <p> {cardN[0].City} </p>
		<a href={cardN[0].web} className="btn btn-primary">Go somewhere</a>
	        </div>
        </div>
    );
})
}
